import React, { useState, useEffect } from 'react';

const Navbar = () => {
  const [quote, setQuote] = useState('');

  useEffect(() => {
    const category = 'fitness';
    const apiKey = 'PmnjG8o1l3F9ebhiqcypOQ==Wfz3XrGGjryRgMQF'; // Replace with your actual API key

    fetch(`https://api.api-ninjas.com/v1/quotes?category=${category}`, {
      method: 'GET',
      headers: {
        'X-Api-Key': apiKey,
      },
    })
      .then((response) => response.json())
      .then((data) => {
        if (data && data.length > 0) {
          setQuote(data[0].quote);
        }
      })
      .catch((error) => console.error('Error fetching quotes:', error));
  }, []);

  return (
    <header className="bg-white shadow">
      <div className="flex flex-wrap items-center justify-between px-6 py-4">
        <h1 className="text-2xl font-bold text-blue-600">Gymmie</h1>
        {quote && <p className="text-sm text-gray-700 italic text-right">{`"${quote}"`}</p>}
      </div>
    </header>
  );
};

export default Navbar;
